import About from './components/pages/About';
import Contact from './components/pages/Contact';
import {BrowserRouter as Router, Route} from 'react-router-dom'


function App() {
  return (

  <Router>

  <div>
   <Navbar/>

<Switch></Switch>
   <Route path="/">
   <Home />
   </Route>

   <Route path="/about">
   <About />
   </Route>

   <Route path="/contact">
   <Contact />
   </Route>

   </div>
  </Router>


  );
}

export default App;
